import React from "react";
import { Link } from "react-router-dom";

const Footer = () => {
  return (
    <div className="h-[200px] flex flex-col items-center justify-center bg-yellow-700">
      <Link
        to={`https://github.com/puscasmadalina?tab=repositories`}
        target="_blank"
      >
        <span>Git Account</span>
      </Link>
      <Link to={`www.linkedin.com/in/puscas-madalina`}>Linkedin Profile</Link>
    </div>
  );
};

export default Footer;
